import './App.css'; 
import { AppBar, Container } from '@mui/material';



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <AppBar><p>Here lies the bar of apps</p></AppBar>
      </header>
        <Container><img src='https://fantasyinmotion.files.wordpress.com/2014/01/dark-soul-witch-fantasy-353840.jpg' /></Container>
        <Container><p>THE</p></Container>
        <Container><p>FUCK</p></Container>
    </div>
  );
}

export default App;
